INSERT INTO `InspectionReport` VALUES (1,1303,1,11,'بالفحص المبدائي تبين وجود اثار عمل سابق و احتراق ف بعض المكونات تم الرفض بسبب عدم توافر مخططات او قطع غيار ',NULL,NULL,NULL,'2025-11-30',NULL,NULL,NULL,NULL,'2025-11-30 22:36:20','2025-11-30 22:36:20',NULL),(2,1421,1,8,'- بناء علي شكوه العميل تبين كسر سوكت الUSB الشمال | تكلفه تغيير السوكت 750 جنيه \n- تم ملاحظه كسر ف مفصله الشاشه جهة اليمين وعلي وشك كسر الشاشه او الخروج من الهاوسنج | تكلفه الاصلاح 1500 جنيه',NULL,NULL,NULL,'2025-12-02',NULL,NULL,NULL,NULL,'2025-12-02 21:34:47','2025-12-02 21:34:47',NULL),(3,1422,1,11,'الشاشه بها مشكله وتحتتاج تغيير تكلفه الشاشه | تكلفه: 2000 جنيه - بالفحص المبدائي تبين وجود اثار سائل علي المازربورد وعلي الهاوسنج الداخلي - يوجد 3 مسامير فقط ف اللابتوب',NULL,NULL,NULL,'2025-12-02',NULL,NULL,NULL,NULL,'2025-12-02 21:42:30','2025-12-02 21:42:30',NULL),(4,1423,1,11,'قاطع باور - العمل تحت رنج تكلفه م500 ل 1250 بحد اقصصي .. في حاله تباين ان الجهاز سيحتاج تكلفه اعلي يتم الرجوع للعميل مباشره قبل اي شئ لتأكيد التكلفه - اللابتوب ناقص مسامير\n\n',NULL,NULL,NULL,'2025-12-03',NULL,NULL,NULL,NULL,'2025-12-03 16:24:50','2025-12-03 16:24:50',NULL),(5,1419,1,11,'\nالحالة عند الاستلام:\nالجهاز قاطع باور ومش بيستجيب للتشغيل.\nتم ملاحظة إن ليبول الضمان منزوع وبالتالي الجهاز خارج الضمان.','- وجود كسر في سوكت الشحن.\n- الكسر سبب تلف في دائرة الشحن، وده السبب الرئيسي لعدم تشغيل الجهاز.\n\nالتكاليف المتوقعة:\n\n⿡ تغيير سوكت الشحن:\n650 جنيه\n\n⿢ إصلاح دائرة الشحن:\nبيتم تحديد رنج تكلفة مبدئي قبل بدء الشغل، وبنلتزم بيه.\nالرنج المتوقع: من 950 لـ 2100 جنيه كحد أقصى\nالسعر النهائي بيتحدد حسب:\nالقطع اللي اتغيرت\nالأعطال اللي اتصلّحت',NULL,NULL,'2025-12-02',NULL,NULL,NULL,NULL,'2025-12-06 18:41:38','2025-12-06 18:41:38',NULL),(6,1431,1,11,'بالفحص المبدائي تبين وجود اثار عمل سابقة علي المازربورد ووجود بعض المكونات التاقصه.\n','تم الفحص وتبين وجود تلف ف دائره ال Type C و دائره ال Standbay Circuit\n(Power System) \n\nتكلفه الاصلاح المقدره 3550 جنيه.\n\nالسبب المتوقع للمشكله\nالشاحن بنسبه كبيره تلف او كوالتي الشاحن مش كويسه ونتيجه لدا اتلف الكنترولر المسأول عن استقبال الجهد و الاشارات الاساسيه من الشاحن وبالتابعيه اتلف دوائر الباور',NULL,NULL,'2025-11-05',NULL,NULL,NULL,NULL,'2025-12-06 19:37:27','2025-12-06 19:37:27',NULL),(7,1432,1,11,'بالفحص المبدئي تبيّن وجود آثار واضحة لعمل سابق غير احترافي على الماذربورد، مع وجود مكونات ناقصة.\nوبالمتابعة ظهر وجود مكونات تالفة وغير متوافقة تم تركيبها بشكل متعمد داخل دائرة الباور، بالإضافة إلى إزالة مكونات من دائرة السويتش (دائرة دخول التغذية الرئيسية)، وتلف في شريحة الـ IO.','تم تغيير جميع المكونات التالفة والناقصة والخاطئة بمكونات متوافقة وسليمة، وإصلاح دائرة الباور بالكامل.\nوأثناء الفحص النهائي تبيّن وجود قطع متعمد في تراكات حساسة بدائرة البروسيسور، وتمت معالجتها بنجاح.\n\nبعد الانتهاء من الإصلاح والاختبار، الجهاز عاد للعمل بشكل طبيعي والحمد لله',NULL,NULL,'2025-12-06',NULL,NULL,NULL,NULL,'2025-12-06 23:07:29','2025-12-06 23:07:29',NULL),(8,1431,1,11,NULL,'أثناء الفحص تم العثور على عدة مكونات تالفة و اخري ناقصه داخل دائرة الـ T.C ودائرة الباور 5 فولت، وكانت هذه الأعطال تسبب عدم استقرار ومشكلة في تشغيل الجهاز.\nتم تغيير جميع المكونات التالفة والناقصة بمكونات متوافقة وسليمة.\nكما تم إصلاح الأعطال الموجودة في دائرة البروسيسور .\nوفي النهاية تم إعادة برمجة البايوس لمعالجة البيانات التالفة وضمان بدء تشغيل الهاردوير بشكل طبيعي.\n\nبعد الانتهاء من الإصلاح والاختبار، اشتغل الجهاز بشكل سليم.\n',NULL,'الرام الموجوده داخل الجهاز غير متوافقه لان الpass speed الخاص بها قليل 2400mhz\nالباس المناسب 3600mhz','2025-11-20',NULL,NULL,NULL,NULL,'2025-12-07 13:17:51','2026-01-01 21:02:45',NULL),(9,1441,1,11,'ةوىوةىو',NULL,NULL,NULL,'2025-12-10',NULL,NULL,NULL,NULL,'2025-12-10 01:32:13','2025-12-21 20:12:46','2025-12-21 20:12:46'),(10,1441,4,11,'بالفحص المبدئي تبيّن وجود انفجار في أحد موسفتات الشحن، مما أدى إلى تلف دائرة الشحن.\nتم استبدال موسفتات الشحن التالفة، وتغيير IC الشحن، بالإضافة إلى بعض المكونات المتضررة من الانفجار داخل نطاق دائرة الشحن.\nبعد الإصلاح والاختبار، عادت دائرة الشحن للعمل بشكل طبيعي وآمن.',NULL,NULL,NULL,'2025-12-21',NULL,NULL,NULL,NULL,'2025-12-10 01:43:39','2025-12-21 20:10:43',NULL),(11,1434,3,8,'تم اصلاح مشكله عدم ستكمال فتح الويندوز و الخطوط الي بتظهر ف الشاشه نتيجه مشكله ف دائره الرام. \n\n',NULL,'- اثناء الفحص تبين وجود ارتفاع كبير فدرجه الحراره لان الجهاز يحتاج صيانه دوريه بتكله 650 جنيه \n- الجهاز يحتوي فقط علي هارد HDD زدا مقلل ادائه جدا و يحتاج اضافه SSD لرفع كفائته ',NULL,'2025-12-13',NULL,NULL,NULL,NULL,'2025-12-13 13:25:49','2025-12-14 13:48:50',NULL),(12,1420,1,8,'بعد الفحص تبين وجود مشكله ف احدي الرامات ال8G وتحتاج لاستبدال \nباس الرامات : 8G 2666HZ',NULL,NULL,NULL,'2025-12-13',NULL,NULL,NULL,NULL,'2025-12-13 14:20:52','2025-12-13 14:20:52',NULL),(13,1444,1,11,'بالفحص تبين وجود دراي ف الPCH وتحتاج ريبولنج ... تم معالجه المشكله ب العاده التسخين علي الماكينه و اصلاح مشكله ف البايوس و الحمدلله عادت للعمل بنجاح ',NULL,NULL,NULL,'2025-12-13',NULL,NULL,NULL,NULL,'2025-12-13 15:37:53','2025-12-13 15:37:53',NULL),(14,1416,1,11,'mkmkm',NULL,NULL,NULL,'2025-12-14',NULL,NULL,NULL,NULL,'2025-12-14 02:10:41','2025-12-14 02:10:41',NULL),(15,1450,1,11,'بالفحص تبين وجود عدد من الديد بكسل فعلا لاكن تم التفاوض مع العميل انها مش مؤسره و ان الجهاز استيراد و الجديد ف الديد بيكسل بيقبو الجهاز لحد 7 دبد بيكسل ... والعميل قال ن مش دي اكبر مشاكله و تفهم مشله الديد بكسل \n\nلاكت المشكله اثانيه ان الشاشه بيظهر فيها خط اسود ف النص بدون مبررات .. طبعا دا مظهرش قدمنا ف الفحص ولا مشكله الwifi ظهرت \nفكان الحل من تجاهنا اننا نعمل صيانه دوريه مبكره كامله للجهاز  و ازاله الاكسده من البورتات و الكروت',NULL,NULL,NULL,'2025-12-14',NULL,NULL,NULL,NULL,'2025-12-14 13:35:31','2025-12-14 13:35:31',NULL),(16,1435,4,11,'بالفحص المبدائي تبين وجود اثار عمل سابق في اكتر من مكان علي المازربورد و وجود اثار تفحم ف دائره البروسيسور.. بعد محاوله الاصلاح للاسف تبين تلف ف البروسيسور. ',NULL,'الجهاز يحتاج لاستبدال المازربورد بالكامل ',NULL,'2025-12-14',NULL,NULL,NULL,NULL,'2025-12-14 13:50:23','2025-12-14 13:50:23',NULL),(17,1447,1,11,'تنيام','منتي',NULL,NULL,'2025-12-15',NULL,NULL,NULL,NULL,'2025-12-15 00:22:37','2025-12-15 00:22:37',NULL),(18,1452,4,8,'تم اصلاح الكسور \n','تم اصلاح كسور الهاوسينح وتريح المفصلات ','بطارية الجهاز لا تعمل بكفاءة ',NULL,'2025-12-15',NULL,NULL,NULL,NULL,'2025-12-15 17:00:47','2025-12-15 17:00:47',NULL),(19,1449,3,11,'بالفحص تبين وجود اثار احتراق علي سوكت الهارد و اختراق الفلاته .. تم ازاله البورت المتضرر و اصلاح مشكله الدائره .. ثم تبين ان في مشكله ف البايوس فتم اصلاحه',NULL,'تم الاستغناء عن الورت التالف و تشغيل الهارد من خلال الdvd عن طريق راك مخصصه',NULL,'2025-12-16',NULL,NULL,NULL,NULL,'2025-12-16 02:50:39','2025-12-16 02:50:39',NULL),(20,1448,3,11,'الحهاز يحتاج ريبولنج بتكلفه 3000',NULL,NULL,NULL,'2025-12-16',NULL,NULL,NULL,NULL,'2025-12-16 02:52:06','2025-12-21 19:54:13',NULL),(21,1455,4,11,' بالفحص لقينا تلف ف دائره الصوت ( السماعه ساليمه) و تم اصلاحه و استبدال المكونات التالفه. \nاما بالنسبه لمشكله الusb ف تم حلها عن طريق تعويض مكونات ناقصه من اول عمليه اصلاح ليه ف الدائره و الحمدلله رجع للعمل بدون مشاكل',NULL,NULL,NULL,'2025-12-22',NULL,NULL,NULL,NULL,'2025-12-22 19:15:52','2025-12-22 19:15:52',NULL),(22,1456,4,11,'بالفحص تبين وجود مشكله ف البروسيسور , الحل الافضل للحاله دي هو استبدال المازربورد',NULL,NULL,NULL,'2025-12-22',NULL,NULL,NULL,NULL,'2025-12-22 19:21:41','2025-12-22 19:21:41',NULL),(23,1457,4,11,'بالفحص المبدائي تبين وجود مشكله ف البايوس .. فتم اصلاح الملف الاوريجينال بنفس الداتا الخاصه بالجهاز و الحمدلله رجع للعمل بكفائه \n(السبب بنسبه كبيره هي اغلاق اللابتوب وهو بيعمل ابديت للبايوس لانه مكنش كامل)\n--- \nبالفحص تبين ان الRTC Battery تحتاج لتغيير .. تم تغييرها. \n\n--- \nللاسف بعد تشغيل الجهاز وفحص الهارد تبين انه تالف ويحتاج تغيير',NULL,NULL,NULL,'2025-12-22',NULL,NULL,NULL,NULL,'2025-12-22 19:29:35','2025-12-22 19:29:35',NULL),(24,1466,4,11,'بالفحص تبين وجود مشكله ف دائره الرام .. تم اصلاحها ثم تبين وجود مشكله ف البايوس فتم اصلاح الملف الاوريجينال و اعاده برمجته \n\nملحوظه مهمه المازربورد لجهاز Latitude 5580 ',NULL,NULL,NULL,'2025-12-29',NULL,NULL,NULL,NULL,'2025-12-29 12:55:56','2025-12-29 12:55:56',NULL),(25,1476,4,11,'بعد الفحص تبين وجود مشاكل ف مناطق متعدده \nتم اصلاح مشكله ف دائره السويتش و تفيير مكونات متضرره \nتم اصلاح دائره ال3 فولت ف دائره الباور و اصلاح شورت ف دائره ال5 فولت',NULL,NULL,NULL,'2025-12-30',NULL,NULL,NULL,NULL,'2025-12-30 18:45:49','2025-12-30 18:45:49',NULL),(26,1471,4,11,'بعد الفحث تبين وجود اكسده كبيره علي السوكت مما ادت لتلف نقاط اللحام و فك السوكت بالكامل نتيجه انكسار الهاوسنج.\n',NULL,'الجهاز يحتاج صيانه دوريه بتكلفه 650 جنيه',NULL,'2025-12-31',NULL,NULL,NULL,NULL,'2025-12-31 13:32:55','2025-12-31 13:32:55',NULL),(27,1463,4,11,'بالفحص تبين وجود مشكله ف البايوس فتم اصلاحها لاكن للاسف تبين وجود مشكله ف الرام ايضا وتحتاج للتغيير\n',NULL,NULL,NULL,'2025-12-31',NULL,NULL,NULL,NULL,'2025-12-31 17:04:29','2025-12-31 17:04:29',NULL),(28,1487,4,11,'اختبار',NULL,NULL,NULL,'2026-01-01',NULL,NULL,NULL,NULL,'2026-01-01 13:15:46','2026-01-06 21:54:01','2026-01-06 21:54:01'),(29,1469,4,11,'فحص نهائي للجودة (QC)',NULL,NULL,NULL,'2026-01-01',NULL,NULL,NULL,NULL,'2026-01-01 13:18:57','2026-01-01 13:18:57',NULL),(30,1482,4,11,'تم الاختبار',NULL,NULL,NULL,'2026-01-01',NULL,NULL,NULL,NULL,'2026-01-01 13:52:01','2026-01-01 13:52:01',NULL),(31,1481,4,11,'فحص نهائي',NULL,NULL,NULL,'2026-01-01',NULL,NULL,NULL,NULL,'2026-01-01 13:52:38','2026-01-01 13:52:38',NULL),(32,1486,3,11,'بالفخص تبين ان في مشكله جزائيه ف البروسيسور وحلها \n1. التغيير \n2. تقليل اداء الجهاز \nوتم تقليل اذاء الحهاز للتجربه وفعلا الجهاز استيبول دلوقتي \nالفانه تحتاج تغيير وجاري توفيرها ',NULL,NULL,NULL,'2026-01-06',NULL,NULL,NULL,NULL,'2026-01-06 21:40:22','2026-01-06 21:40:22',NULL),(33,1473,3,8,'بالفحص تبين تهييس ف الصوت اوقات يعمل و اوقات لا يعمل \n\nسيتم فحص دائره الصوت و استبدال التالف',NULL,NULL,NULL,'2026-01-04',NULL,NULL,NULL,NULL,'2026-01-06 22:11:04','2026-01-06 22:11:04',NULL),(34,1470,4,11,'بعد الفحص و اعمل محاولات للصيانه للاسف تبين ان التلف ف الCPU و الحل \n1- تغيير البروسيسور وجا بتكلفه 11500 جنيه لبروسيسور بنفس المواصفات Ryzen7\n2- تغيير لبروسيسور اقل ف المواصفات Ryzen 5 بتكلفه 9500 جنيه\n3- استبدال البرده بالكامل بتكلفه 16500 جنيه. بمواصفات \n - CPU : Ryzen 7\n - GPU : RTX 3060 6G',NULL,NULL,NULL,'2026-01-06',NULL,NULL,NULL,NULL,'2026-01-06 22:31:13','2026-01-06 22:31:13',NULL),(35,1491,4,11,'بالفحص تبين وجود مشكه ف دائره الشحن ... تم حصر المكونات التالفه و استبدالها و الحمدلله الجهاز رجع طبيعي\n\nهيلث البطاريه fair للاسف و قتها هيكو قليل \nالجهاز يحتاج صيانه دوريه ف الوقت القريب',NULL,'- استبدال البطاريه ف حاله ان الوقت غير مناسب \n- عمل صيانه دوريه للجهاز ف اقرب وقت الخطط المتاحه ( 850 - 1200 ) تختلف علي كوالتي الثيرمل بيست لامن الاتنين مناسبين لمواصفات الجهاز ',NULL,'2026-01-07',NULL,NULL,NULL,NULL,'2026-01-07 15:32:26','2026-01-07 15:43:48',NULL),(36,1491,1,11,'فحص نهائي للجودة (QC)',NULL,NULL,NULL,'2026-01-07',NULL,NULL,NULL,NULL,'2026-01-07 15:32:54','2026-01-07 15:33:03','2026-01-07 15:33:03'),(37,1487,4,11,'بالفحص تبين وجود مشكله ف البايوس - تم اصلاح الملف الاورجينال و تشغيل الجهاز ',NULL,NULL,NULL,'2026-01-07',NULL,NULL,NULL,NULL,'2026-01-07 16:04:22','2026-01-07 16:04:22',NULL),(38,1480,4,8,'بالفحص تبين وجود مشكله ف دائره الباور .. تم حصر المكونات التالفه و الحمدلله بعد استبدالها رجع الجهاز للعمل بشكل طبيعي\n - اللابتوب كان يحتاج صيانه دوريه وتم عملها للحفاظ علي الاداء.',NULL,NULL,NULL,'2026-01-07',NULL,NULL,NULL,NULL,'2026-01-07 16:54:09','2026-01-07 16:54:15',NULL);
