CREATE TABLE `InvoiceItem` (
  `id` int NOT NULL AUTO_INCREMENT,
  `quantity` int DEFAULT NULL,
  `unitPrice` decimal(12,2) DEFAULT NULL,
  `totalPrice` decimal(12,2) DEFAULT NULL,
  `invoiceId` int DEFAULT NULL,
  `serviceId` int DEFAULT NULL,
  `inventoryItemId` int DEFAULT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `itemType` enum('part','service','other') COLLATE utf8mb4_unicode_ci DEFAULT 'part',
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deletedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `invoiceId` (`invoiceId`),
  KEY `serviceId` (`serviceId`),
  KEY `inventoryItemId` (`inventoryItemId`),
  KEY `idx_invoice_item_deletedAt` (`deletedAt`),
  KEY `idx_invoice_item_invoiceId` (`invoiceId`),
  KEY `idx_invoice_item_inventoryItemId` (`inventoryItemId`),
  CONSTRAINT `InvoiceItem_ibfk_1` FOREIGN KEY (`invoiceId`) REFERENCES `Invoice` (`id`),
  CONSTRAINT `InvoiceItem_ibfk_2` FOREIGN KEY (`serviceId`) REFERENCES `Service` (`id`),
  CONSTRAINT `InvoiceItem_ibfk_3` FOREIGN KEY (`inventoryItemId`) REFERENCES `InventoryItem` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1957 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
