DROP TABLE IF EXISTS `InvoiceTemplate`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `InvoiceTemplate` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'اسم القالب',
  `type` enum('standard','tax','commercial','service','receipt') COLLATE utf8mb4_unicode_ci DEFAULT 'standard' COMMENT 'نوع القالب',
  `description` text COLLATE utf8mb4_unicode_ci COMMENT 'وصف القالب',
  `headerHTML` text COLLATE utf8mb4_unicode_ci COMMENT 'HTML الرأس',
  `footerHTML` text COLLATE utf8mb4_unicode_ci COMMENT 'HTML التذييل',
  `stylesCSS` text COLLATE utf8mb4_unicode_ci COMMENT 'أنماط CSS مخصصة',
  `settings` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT 'إعدادات القالب (ألوان، خطوط، شعار، إلخ)',
  `isDefault` tinyint(1) DEFAULT '0' COMMENT 'هل هو القالب الافتراضي لهذا النوع',
  `isActive` tinyint(1) DEFAULT '1' COMMENT 'هل القالب نشط',
  `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deletedAt` timestamp NULL DEFAULT NULL COMMENT 'تاريخ الحذف المنطقي',
  PRIMARY KEY (`id`),
  KEY `idx_template_type` (`type`),
  KEY `idx_template_default` (`isDefault`),
  KEY `idx_template_active` (`isActive`),
  KEY `idx_template_deleted` (`deletedAt`),
  CONSTRAINT `InvoiceTemplate_chk_1` CHECK (json_valid(`settings`))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='قوالب الفواتير';
