CREATE TABLE `MessagingLog` (
  `id` int NOT NULL AUTO_INCREMENT,
  `entityType` enum('invoice','repair','quotation','payment','custom') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'نوع الكيان',
  `entityId` int NOT NULL COMMENT 'معرف الكيان',
  `customerId` int DEFAULT NULL COMMENT 'معرف العميل',
  `channel` enum('whatsapp','email','sms') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'قناة الإرسال',
  `recipient` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'رقم الهاتف أو البريد الإلكتروني',
  `message` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'نص الرسالة',
  `template` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'اسم القالب المستخدم',
  `subject` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'عنوان الرسالة (للبريد الإلكتروني)',
  `status` enum('pending','sent','delivered','failed','read') COLLATE utf8mb4_unicode_ci DEFAULT 'pending' COMMENT 'حالة الإرسال',
  `sentBy` int DEFAULT NULL COMMENT 'معرف المستخدم الذي أرسل الرسالة',
  `sentAt` datetime DEFAULT NULL COMMENT 'وقت الإرسال',
  `deliveredAt` datetime DEFAULT NULL COMMENT 'وقت التسليم',
  `readAt` datetime DEFAULT NULL COMMENT 'وقت القراءة',
  `errorMessage` text COLLATE utf8mb4_unicode_ci COMMENT 'رسالة الخطأ',
  `retryCount` int DEFAULT '0' COMMENT 'عدد محاولات الإعادة',
  `lastRetryAt` datetime DEFAULT NULL COMMENT 'وقت آخر محاولة',
  `metadata` json DEFAULT NULL COMMENT 'بيانات إضافية (مثل رابط PDF، معلومات API response، إلخ)',
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'وقت الإنشاء',
  `updatedAt` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'وقت التحديث',
  PRIMARY KEY (`id`),
  KEY `sentBy` (`sentBy`),
  KEY `idx_entity` (`entityType`,`entityId`) COMMENT 'بحث سريع حسب الكيان',
  KEY `idx_customer` (`customerId`) COMMENT 'بحث سريع حسب العميل',
  KEY `idx_recipient` (`recipient`) COMMENT 'بحث سريع حسب المستلم',
  KEY `idx_status` (`status`) COMMENT 'فلترة حسب الحالة',
  KEY `idx_channel` (`channel`) COMMENT 'فلترة حسب القناة',
  KEY `idx_sent_at` (`sentAt`) COMMENT 'ترتيب حسب وقت الإرسال',
  KEY `idx_created_at` (`createdAt`) COMMENT 'ترتيب حسب وقت الإنشاء',
  KEY `idx_status_created` (`status`,`createdAt`) COMMENT 'فلترة وترتيب مركب',
  CONSTRAINT `MessagingLog_ibfk_1` FOREIGN KEY (`customerId`) REFERENCES `Customer` (`id`) ON DELETE SET NULL,
  CONSTRAINT `MessagingLog_ibfk_2` FOREIGN KEY (`sentBy`) REFERENCES `User` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=348 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='سجل شامل لجميع محاولات إرسال الرسائل للعملاء';
